import React from "react";
import './nav.css';
import {FaHome, FaUser} from 'react-icons/fa';

function Nav () {
    return (
        <nav>
            <ul>
                <li><a href="#"  className="home-fa"><FaHome/><span>Home</span></a></li>
                <li><a href="#"  className="about-fa"><FaUser/><span>About</span></a></li>
                <li><a href="#"  className="skills-fa"><FaHome/><span>Skills</span></a></li>
                <li><a href="#"  className="projects-fa"><FaHome/><span>Projects</span></a></li>
                <li><a href="#"  className="contact-fa"><FaHome/><span>Contact</span></a></li>
            </ul>
        </nav>
    );
}

export default Nav;
